import React, { Component } from 'react';
import pageOne from './images/pg1.jpg';
import pageTwo from './images/pg2.jpg';

class SmallCardPanel extends Component {
	static defaultProps = {
		name: 'Card1',
		src: pageOne
	};
	render () {
		return (
			<div>
				<img src={this.props.src} />
			</div>
		);
	}
}

export default SmallCardPanel;
